import React from'react';
import Navigation from './components/navigation/Navigation';
import Logo from './components/Logo';
import Tilt from 'react-parallax-tilt';

function App( {Component} ) {
  return (
    <div className="App">
      <Navigation />
      <Tilt>
        <Logo />
      </Tilt>
      {/* <ImageLinkForm />
      <FaceRecognition /> */}
    </div>
  );
}

export default App;
